import React from "react";
import "./footer.styles.css";
import twitter from '../../media/twitter.jpg'
import fb from '../../media/facebook.jpg'
import git from '../../media/github.jpg'
import insta from '../../media/instagram.jpg'
import linked from '../../media/linkedin.jpg'


function Footer(){
    return(

        <div className="footer">
            <a href=""><img src={twitter} alt="h" /></a>
            <a href=""><img src={fb} alt="g" /></a>
            <a href="https://www.instagram.com/dim_ap/"><img src={insta} alt="f" /></a>
            <a href=""><img src={linked} alt="d" /></a>
            <a href=""><img src={git} alt="s" /></a>
        </div>



    )
}


export default Footer;
